import './App.css';
import ShowsContainer from './ShowsContainer';
import movieimages from "./data/movies-with-images.json";
import MovieCard from './MovieCard';

function App() {

  return (
    <div className="App">
      <ShowsContainer>
      {movieimages.slice(0,50).map(movie => 
      <MovieCard movie={movie} />
      )}
      </ShowsContainer>
    </div>
  );
}

export default App;
